UPDATE media SET metadata = CONCAT('{"size" : ' , FLOOR(1 + RAND() * 1000000), ', "extension" : "wav", "duration" : ', FLOOR(1 + RAND() * 100000), '}')
WHERE media_type_id = 1;

UPDATE media SET metadata = CONCAT('{"size" : ' , FLOOR(1 + RAND() * 1000000), ', "extension" : "png", "resolution" : "', CONCAT_WS('x', FLOOR(100 + RAND() * 1000), FLOOR(100 + RAND() * 1000)), '"}')
WHERE media_type_id = 2;

UPDATE media SET metadata = CONCAT('{"size" : ' , FLOOR(1 + RAND() * 1000000), ', "extension" : "mp4", "resolution" : "', CONCAT_WS('x', FLOOR(100 + RAND() * 1000), FLOOR(100 + RAND() * 1000)), '", "duration" : "', FLOOR(1 + RAND() * 100000), '"}')
WHERE media_type_id = 3;

UPDATE media SET metadata = CONCAT('{"size" : ' , FLOOR(1 + RAND() * 10000), ', "extension" : "gif", "resolution" : "', CONCAT_WS('x', FLOOR(100 + RAND() * 500), FLOOR(100 + RAND() * 500)), '", "duration" : "', FLOOR(1 + RAND() * 100), '"}')
WHERE media_type_id = 4;

UPDATE media SET metadata = CONCAT('{"size" : ' , FLOOR(1 + RAND() * 100), ', "extension" : "doc"}')
WHERE media_type_id = 5;

UPDATE media SET filename = CONCAT_WS('.', filename, metadata->"$.extension")
WHERE media_type_id = 1 OR media_type_id = 2 OR media_type_id = 3 OR media_type_id = 4 OR media_type_id = 5;

UPDATE messages SET
	from_user_id = FLOOR(1 + RAND() * 100),
    to_user_id = FLOOR(1 + RAND() * 100) 
     WHERE id < 200;

UPDATE friendship SET
	user_id = FLOOR(1 + RAND() * 100),
    friend_id = FLOOR(1 + RAND() * 100) 
     WHERE user_id < 200;
     

UPDATE posts SET user_id = FLOOR(1 + RAND() * 100) WHERE id < 200;
    

UPDATE posts_media SET
	post_id = FLOOR(1 + RAND() * 100),
    media_id = FLOOR(1 + RAND() * 10) 
     WHERE post_id < 200;
     




UPDATE likes_posts SET
	user_id = FLOOR(1 + RAND() * 100),
    post_id = FLOOR(1 + RAND() * 100) 
     WHERE post_id < 200;


UPDATE likes_users SET
	setter_user_id = FLOOR(1 + RAND() * 100),
    getter_user_id = FLOOR(1 + RAND() * 100) 
     WHERE setter_user_id < 200;
     
UPDATE communities_users SET
	community_id = FLOOR(1 + RAND() * 100),
    user_id = FLOOR(1 + RAND() * 100) 
     WHERE community_id < 200;
     
